	public static int sizeOfNormalCDF(){return Helper.Normal_CDF.length;}
	public static Item addNormalCDF(Item it){
		if(it instanceof CAR){
			if(((CAR)it).getDriver()!=null){
				CAR car=((CAR)it).copy();
				double sigema=((CAR)it).getDriver().getNormalSigema();
//				Helper.getDebugger().debug(Debugger.DEBUGGER_Simulation,"id="+((CAR)it).id);
//				Helper.getDebugger().debug(Debugger.DEBUGGER_Simulation," v="+car.getV());
				car.setV(Helper.addNormalCDF(car.getDriver().getNormalRand(),car.getDriver().getNormalU(),
						car.getV(),sigema,car.getVmax()));
//				Helper.getDebugger().debug(Debugger.DEBUGGER_Simulation,"nv="+car.getV());
//				Helper.getDebugger().debug(Debugger.DEBUGGER_Simulation," a="+car.getA());
				car.setA(Helper.addNormalCDF(car.getDriver().getNormalRand(),car.getDriver().getNormalU(),
						car.getA(),sigema,car.getAmax()));
//				Helper.getDebugger().debug(Debugger.DEBUGGER_Simulation,"na="+car.getA());
				return car;
			}
		}
		return it.copy();
	}
	private static double addNormalCDF(double rand,double u,double x,double sigema,double max){
		
		sigema=Math.max(x/3.0,Math.min((max-x)/3.0,sigema));
		double z;
		int len=Helper.sizeOfNormalCDF();
		for(int i=0;i<len;i++){
			if(rand<Helper.Normal_CDF[i]+1e-7||i>=len-1){
				z=(double)i/(double)Helper.Normal_CDF.length*6.0-3.0;
				//z=(x-(1+u)x)/sigema=-u/sigema*x
				return x-z*sigema/u;
			}
		}//*/
		return x;
	}
	
	public static void circleCar(CAR car,WL o,WL q,Graphics g,JPanel panel,Color inner,Color outer){
		if(car==null) return;
		WL center=car.getCenter().cheng(q).jia(o);
		WL wh=car.getWH().cheng(q);
		double r1=wh.mochang()/2+2;
		double r2=r1+DrawControler.focus_radis;
		WL a=center.jian(new WL(r2));
		WL b=center.jian(new WL(r1));
		g.setColor(outer);
		g.fillOval(a.X2I(),a.Y2I(),(int)r2*2,(int)r2*2);
		g.setColor(inner);
		g.fillOval(b.X2I(),b.Y2I(),(int)r1*2,(int)r1*2);
	}
	
